import React from 'react';
import './Skills.css';

const Skills = () => {
  return (
    <section className="container">
      <h2>Technical Skills</h2>
      <ul>
        <li><strong>Languages:</strong> JavaScript, Google Apps Script, HTML/CSS, PHP</li>
        <li><strong>Platforms:</strong> Asana, Copper CRM, Google Workspace, WHMCS, Zapier, Make.com, n8n</li>
        <li><strong>APIs:</strong> Google APIs, RESTful API Integration</li>
        <li><strong>Tools:</strong> Google Sheets, Slack, Git, VS Code</li>
        <li><strong>Expertise:</strong> Workflow Automation, Process Optimization, Front-End UI Development, No/Low-Code Solutions</li>
      </ul>
    </section>
  );
};

export default Skills;
